rt = min - pad;\n            range.end = max + pad;\n        } else console.error('backtesting: scale range error:', min, max, range);\n    };\n}\n\nclearTimeout(window._bt_autoscale_timeout);\n\nwindow._bt_autoscale_timeout = setTimeout(function () {\n    /**\n     * @variable cb_obj `fig_ohlc.x_range`.\n     * @variable source `ColumnDataSource`\n     * @variable ohlc_range `fig_ohlc.y_range`.\n     * @variable volume_range `fig_volume.y_range`.\n     */\n    \"use strict\";\n\n    let i = Math.max(Math.floor(cb_obj.start), 0),\n        j = Math.min(Math.ceil(cb_obj.end), source.data['ohlc_high'].length);\n\n    let max = Math.max.apply(null, source.data['ohlc_high'].slice(i, j)),\n        min = Math.min.apply(null, source.data['ohlc_low'].slice(i, j));\n    _bt_scale_range(ohlc_range, min, max, true);\n\n    if (volume_range) {\n        max = Math.max.apply(null, source.data['Volume'].slice(i, j));\n        _bt_scale_range(volume_range, 0, max * 1.03, false);\n    }\n\n}, 50);\n"},"id":"1756596","type":"CustomJS"},{"attributes":{"data":{"Close":{"__ndarray__":"MzMzMzNzW0BxPQrXowBbQNejcD0KN1tAKVyPwvXoWUDXo3A9CjdaQNejcD0K91lAcT0K16PwWUCF61G4HhVaQClcj8L1iFpA9ihcj8KlWkApXI/C9ahZQEjhehSup1lAzczMzMw8WkBmZmZmZlZaQM3MzMzMTFpAZmZmZmZGWkCkcD0K11NZQEjhehSuN1lA16NwPQo3WUAUrkfhejRZQBSuR+F6ZFlApHA9CtfTWUCkcD0K16NZQI/C9Shcr1lAw/UoXI/yWUB7FK5H4TpaQNejcD0K51lAw/UoXI/SWUBSuB6F69FZQI/C9Shcv1lACtejcD16WUAfhetRuI5ZQGZmZmZmhllArkfhehRuWUAK16NwPYpZQGZmZmZmdllAj8L1KFyvWUA9CtejcN1ZQOF6FK5HAVpAmpmZmZkJWkAzMzMzM/NZQPYoXI/CFVpAmpmZmZnJWUApXI/C9bhZQB+F61G4nllAw/UoXI/CWUCF61G4HtVZQOxRuB6FK1pAFK5H4XpEWUB7FK5H4UpZQPYoXI/CRVlAPQrXo3A9WUDsUbgehXtZQPYoXI/CpVlACtejcD26WUBmZmZmZuZZQFK4HoXrEVpA16NwPQqXWkCF61G4HpVaQGZmZmZm5lpAFK5H4Xr0WkDsUbgehQtbQHE9CtejQFtAAAAAAADAW0DhehSuR9FbQNejcD0KZ1tAZmZmZmamW0DXo3A9CrdbQAAAAAAAsFtApHA9CtfDW0AUrkfheqRbQEjhehSut1tAXI/C9SicW0BSuB6F68FbQIXrUbgelVtAAAAAAAAwW0CPwvUoXP9aQHsUrkfhOltAMzMzMzNjW0CkcD0K10NbQNejcD0KZ1tAhetRuB61W0DD9Shcj+JbQAAAAAAA0FtAj8L1KFwfXEAAAAAAAMBbQAAA
